import BaseService from './baseService.js'
import cloneDeep from 'lodash/cloneDeep'

class ProductService extends BaseService{
    getContentCategory(opts = {}){
        this.endPoint = '/get-content-categories'
        return this.get(opts)
    }

    storeContentCategory(payload, opts ={}){
        this.endPoint = '/content-categories'
        return this.post(payload, opts);
    }

    updateContentCategory(id, payload, opts = {}) {
        this.endPoint = `/content-categories`;
        return this.putOne(id, payload, opts);
    }

    deleteContentCategory(id, opts = {}){
        this.endPoint = '/content-categories'
        return this.delete(id, opts)
    }
    getContent(opts = {}){
        this.endPoint = '/users'
        return this.get(opts)
    }

    storeContent(payload, opts ={}){
        this.endPoint = '/users'
        return this.post(payload, opts);
    }

    updateContent(id, payload, opts = {}) {
        this.endPoint = `/users`;
        return this.putOne(id, payload, opts);
    }

    deleteContent(id, opts = {}){
        this.endPoint = '/users'
        return this.delete(id, opts)
    }

}

export default new ProductService()
